import React from "react";
import { BsInstagram, BsPinterest, BsTiktok, BsTwitter, BsMailbox } from 'react-icons/bs';
import { Link } from 'react-router-dom';

const Footer : React.FC = () => {
    return(
        <>
            <div className="flex justify-between">
                <div className="text-3xl flex-col">
                    <p className="font-marker">sketchsauce</p>
                    <div className="flex">
                        <BsTiktok className="m-2"/>
                        <BsInstagram className="m-2"/>
                        <BsTwitter className="m-2"/>
                        <BsPinterest className="m-2"/>
                    </div>
                </div>
                <div className="flex-col text-2xl">
                    <BsMailbox />
                    <p className="font-marker">mail</p>
                    <p className="font-marker">
                        <a href="mailto: info@sketchsauce.no">info@sketchsauce.no</a>
                    </p>
                </div>
            </div>
        </>
    );
}

export default Footer;
